    <script>

$(document).on('click', '.sharingbtn', function(event) {
    // Get the product slug from the data attribute or any other source

    // Get the slug from the data attribute
    var productSlug = $(this).data('slug');
    var productUrl = "{{ url('product') }}/" + productSlug;

    // Set the slug in the modal
    $('#productSlug').text(productUrl);

    // Update sharing links
    $('#facebookShare').attr('href', 'https://www.facebook.com/sharer/sharer.php?u=' + encodeURIComponent(productUrl));
    $('#twitterShare').attr('href', 'https://twitter.com/intent/tweet?url=' + encodeURIComponent(productUrl));
    $('#whatsappShare').attr('href', 'https://api.whatsapp.com/send?text=' + encodeURIComponent(productUrl));


    // window.open(facebookShareUrl, '_blank', 'width=600,height=400');

    $('#copyLink').on('click', function() {
        var $this = $(this);
        var originalColor = $this.css('background-color'); // Store the original color
        navigator.clipboard.writeText(productUrl).then(function() {

            var $copiedBtn = $('#copiedBtn');
            $copiedBtn.css({'right': '0px', 'opacity': '1'}).show(); // Reset position and opacity

             // Animate the "Code Copied" button to move 5px left and fade out
             $copiedBtn.animate({
            right: '+=30px',
            opacity: 0
            }, 1000, function() {
            // Hide the button after the animation is complete
             $copiedBtn.hide();
             $copiedBtn.css('opacity', '1'); // Reset the opacity for the next click
            });

            // $this.css('background-color', '#7e9a402d');
            setTimeout(function() {
            $this.css('background-color', originalColor);


        }, 1000); // 1000 milliseconds = 1 second
        });
    });

    // Show the modal
    $('#sharingModal').modal('show');
});


$(document).ready(function() {
    // window.location.href = 'https://hpanel.hostinger.com/';

    // Handle the "Check All" checkbox
    $(document).on("change", ".check-all", function() {
        $('.check-one:checkbox').prop('checked', this.checked);
        console.log('hi');
        toggleDeleteButton(); // Call the function to handle the button visibility
    });

    // Handle individual checkbox changes
    $(document).on("change", ".check-one", function() {
        toggleDeleteButton(); // Call the function to handle the button visibility
    });

    // Function to toggle the visibility of the delete button
    function toggleDeleteButton() {
        var selectedCount = $('.check-one:checked').length;
        var totalCount = $('.check-one').length;
        var allChecked = $('.check-all').prop('checked');

        if (allChecked || selectedCount > 1) {
            $('#bulk-delete-btn').removeClass('d-none').addClass('d-block');
        } else {
            $('#bulk-delete-btn').removeClass('d-block').addClass('d-none');
        }
    }
});

document.addEventListener('click', function() {
    const latestProduct = document.querySelector('.underline');
    if (latestProduct) {
        latestProduct.classList.remove('underline');
    }
});


        function update_featured(el){
            if(el.checked){
                var status = 1;
            }
            else{
                var status = 0;
            }
            $.post('{{ route('seller.products.featured') }}', {_token:'{{ csrf_token() }}', id:el.value, status:status}, function(data){
                if(data == 1){
                    AIZ.plugins.notify('success', '{{ translate('Featured products updated successfully') }}');
                }
                else{
                    AIZ.plugins.notify('danger', '{{ translate('Something went wrong') }}');
                    location.reload();
                }
            });
        }

        function update_published(el){
            if(el.checked){
                var status = 1;
            }
            else{
                var status = 0;
            }
            $.post('{{ route('seller.products.published') }}', {_token:'{{ csrf_token() }}', id:el.value, status:status}, function(data){
                if(data == 1){
                    AIZ.plugins.notify('success', '{{ translate('Published products updated successfully') }}');
                }
                else if(data == 2){
                    AIZ.plugins.notify('danger', '{{ translate('Please upgrade your package.') }}');
                    location.reload();
                }
                else{
                    AIZ.plugins.notify('danger', '{{ translate('Something went wrong') }}');
                    location.reload();
                }
            });
        }

        function bulk_delete() {
            var data = new FormData($('#sort_products')[0]);
            $.ajax({
                headers: {
                    'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
                },
                url: "{{route('seller.products.bulk-delete')}}",
                type: 'POST',
                data: data,
                cache: false,
                contentType: false,
                processData: false,
                success: function (response) {
                    if(response == 1) {
                        location.reload();
                    }
                }
            });
        }

        document.addEventListener('DOMContentLoaded', function() {
    const selectBox = document.querySelector('.select-box');
    const optionsList = document.querySelector('.options-list');
    const options = document.querySelectorAll('.option');
    const selected = document.querySelector('.selected');
    const hiddenInput = document.querySelector('input[name="category"]');

    selectBox.addEventListener('click', function() {
        optionsList.style.display = optionsList.style.display === 'block' ? 'none' : 'block';
    });

    options.forEach(option => {
        option.addEventListener('click', function() {
            selected.textContent = this.textContent;
            hiddenInput.value = this.dataset.value;
            options.forEach(opt => opt.classList.remove('selected'));
            this.classList.add('selected');
            optionsList.style.display = 'none';
        });
    });

    document.addEventListener('click', function(e) {
        if (!selectBox.contains(e.target)) {
            optionsList.style.display = 'none';
        }
    });
});



    </script>
